import { NavBar } from './components/sections/navBar.js';
import { Footer } from './components/sections/footer.js';
import { RegistrationForm } from './pages/registrationPage.js';
import { Header } from './pages/homePage.js';
import './css/style.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">

        <NavBar />
        <RegistrationForm /> 
        <Header />
        <Footer />


      </header>
    </div>
  );
}

export default App;
